3. Duration and Cessation of Obligations.

Upon the occurrence of any of the following events, either Party may terminate this Agreement without further obligation or liability:

(a) Material breach by one Party of its obligations under this Agreement that remains uncured for a period of thirty (30) days after written notice is given;

(b) Insolvency or bankruptcy proceedings initiated against either Party, whether voluntarily or involuntarily;

(c) The dissolution or liquidation of either Party;

(d) A governmental body revoking the necessary permits, licenses, or approvals required for the performance of this Agreement; or

(e) Any other event that makes it impracticable to fulfill the obligations under this Agreement as originally intended.

Upon termination, each Party shall promptly return any property of the other Party and cease using the Confidential Information disclosed during the term of this Agreement. The surviving Party may retain any payments or benefits received prior to termination.
